import { jsPDF } from "jspdf"
var font = '';
var callAddFont = function () {
this.addFileToVFS('THSarabunChula-Bold-normal.ttf', font);
this.addFont('THSarabunChula-Bold-normal.ttf', 'THSarabunChula-Bold', 'normal');
};
jsPDF.API.events.push(['addFonts', callAddFont])

export const family = 'Sarabun';
export const src = font;